import React, { Component } from 'react';
import "../Css/Data.css";
import GitHubRepos from "../Another.js";


class Data extends Component {
  render() {
    return (
          <div className="table">
          <h2 className="head"> Github Repositories</h2>
          <p className="txt">Here are most of my github Repositories to view. 
          <br/>To see them in more detail click on their names to go to that repositories page or click <a className="lnk" href="https://github.com/mikifriki">here</a> to visit my github</p>
          <GitHubRepos />

          </div>      
    )
  }
}


  export default Data;
